import React from "react";

const Footer = () => {
  const data = [
    {
      title: "Strony internetowe",
      data: [
        "Strony i serwisy WWW",
        "Sklepy Internetowe",
        "Systemy i aplikacje",
        "Domeny i hostingi",
      ],
    },
  ];
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-content__box-wrap">
          {data.map((item) => {
            const { title, data } = item;
            return (
              <div className="footer-content__box">
                <div className="footer-content__box-title">{title}</div>
                <ul className="footer-content__box-list">
                  {data.map((value) => (
                    <li className="footer-content__box-item"></li>
                  ))}
                </ul>
              </div>
            );
          })}
          {/* {data.map((item, i) => {

           return <li key={i}>Test</li>;
          })} */}
        </div>
      </div>
      <div className="footer__bar">
        <p>Wszelkie Prawa Zastrze≈ºone. Intro Rafter &copy; 2020</p>
      </div>
    </footer>
  );
};

export default Footer;
